import { useDispatch, useSelector } from 'react-redux'
import getMy from '../features/device/deviceSlice'


export default function Devices() {
    const devices = [
        {
            "mac": "213",
            "type": "13"
        },
        {
            "mac": "mac2",
            "type": "laptop2"
        },
        {
            "mac": "mac3",
            "type": "phone"
        }
    ]
    return (
        <div className="container">
            <div className="text-center mb-3">
                <h1>My Devices</h1>
                <p className="lead">To add a new device click here</p>
            </div>
            <hr />
            <DevicesTable devices={devices} />
        </div>
    )
}


function DevicesTable({ devices }) {
    let rows = []

    for (let id in devices) {
        rows.push(<DeviceTableRow key={id} device={devices[id]} />)
    }

    return (
        <table className="table align-middle fs-5">
            <thead>
                <tr>
                    <th>MAC Address</th>
                    <th>Type</th>
                    <th></th>
                </tr>
            </thead>
            <tbody>
                {rows}
            </tbody>
        </table>
    )
}


function DeviceTableRow({ device }) {
    return (
        <tr>
            <td>
                {device['mac']}
            </td>
            <td>
                {device['type']}
            </td>
            <td>
                <button type="button" className="btn btn-outline-danger">delete</button>
            </td>
        </tr>
    )
}
